import ajax from './ajax'

const BASE = 'http://localhost:8080'
// const BASE = ''

export function reqLogin(phone, password) {
    ajax({
        method: 'post',
        url: BASE + '/login',
        data: {
            phone,
            password
        }
    })
}

const phone='123'
const password='123'
reqLogin(phone,password)
console.log('@')
